import Graph from "./Graph";

function Strategy(props) {
  return (
    <div
    style={{
      border: "1px solid black",
      display: "inline-block",
      padding: "0 10px"
    }}
    >
      {props.name}
      <Graph />
    </div>
  );
}

export default Strategy;
